import React, { Component } from 'react';
import { Link } from "react-router-dom";

class Header extends Component {
    render() {
        return (
            <div>
                <nav className="navbar row">
                    <div className="container-fluid col">
                    <Link to="/"><span className="navbar-brand mb-0 h1" >Moviely</span></Link>
                    </div>
                    <div className="col">
                        <span className="btn btn-outline-secondary ">Add Movie</span>
                    </div>
                    <div className="col">
                        <span>
                            <div className="input-group-sm">
                                <label><button className="btn btn-outline-secondary" type="button" id="button-addon1">Items In Page</button></label>
                                <input type="number" className="form-control" placeholder="Enter number"/>
                            </div>
                        </span>
                    </div>
                </nav>
            </div>
        );
    }
}

export default Header;
